export const USER_INFO_LOADING = "USER_INFO_LOADING";
export const USER_INFO_FAIL = "USER_INFO_FAIL";
export const USER_INFO_SUCCESS = "USER_INFO_SUCCESS";
export const USER_AGE_LOADING = "USER_AGE_LOADING";
export const USER_AGE_FAIL = "USER_AGE_FAIL";
export const USER_AGE_SUCCESS = "USER_AGE_SUCCESS";

export type UserType = {
  results: UserInfo[];
};

export type Age = {
   age : UserAge[];
}

export type UserInfo = {
  gender: string;
  name: {
    title: string;
    first: string;
    last: string;
  };
  location: {
    city: string;
  };
  dob: {
    date: string;
  };
};

export type UserAge = {
    age:number
}

export interface userInfoLoading {
  type: typeof USER_INFO_LOADING;
}

export interface userInfoFail {
  type: typeof USER_INFO_FAIL;
}

export interface userAgeLoading {
  type: typeof USER_AGE_LOADING;
}

export interface userAgeFail {
  type: typeof USER_AGE_FAIL;
}


export interface userInfoSuccess {
  type: typeof USER_INFO_SUCCESS;
  payload: UserType;
}

export interface userAgeSuccess {
    type: typeof USER_AGE_SUCCESS;
    payload: Age;
}



  

export type userDispatchTypes =
  | userInfoLoading
  | userInfoFail
  | userInfoSuccess
  | userAgeLoading
  | userAgeSuccess
  | userAgeFail;
